import React from 'react';

const RoomList = ({ rooms }) => {
    return (
        <div className="room-list">
            {rooms.map((room) => (
                <div key={room.id} className="room-card">
                    <h2>Habitaci√≥n {room.id}</h2>
                    <p>Precio para 1 persona: {room.price1} CLP</p>
                    <p>Precio para 2 personas: {room.price2} CLP</p>
                    <p>Disponibilidad: <span className="available">Disponible</span></p>
                    <button className="reserve-btn">Reservar</button>
                </div>
            ))}
        </div>
    );
};

export default RoomList;
